import { useEffect } from "react";

const URL = "http://geek.itheima.net/v1_0/channels";

function App() {
  useEffect(() => {
    const getList = async () => {
      const res = await fetch(URL);
      console.log(res);
    };
    getList();
  }, []);
  return <div className="App"></div>;
}

export default App;
